import React, {useState } from "react";

const [user, setUser] = useState([])

function App(props) {

  const l = user.map(items => {
    return <li key={items.id}>{items.title}</li>
  })

  return (
    <div>
      <button onClick={getPosts}>get</button>
      <ul>{l}</ul>
    </div>
  );
}

function GetPosts() {
  axios.get('http://localhost:8000/api/upv/')
  .then(res => {
    setUser(res.data)
})
}

export default App;
